import React, { useState } from "react";
import "./App.css";

function App() {
  const [folderPath, setFolderPath] = useState(""); // Store the folder path
  const [message, setMessage] = useState(""); // Display messages to the user

  // Handle changes in the text input for folder path
  const handleFolderChange = (event) => {
    setFolderPath(event.target.value); // Update the folder path state
  };

  // Handle manual folder selection
  const handleFolderSelect = (event) => {
    const files = event.target.files;
    if (files.length > 0) {
      // Get the full path of the first file and extract the folder path
      const fullPath = files[0].path || files[0].webkitRelativePath;
      const folderPath = fullPath.substring(0, fullPath.lastIndexOf("/"));
      setFolderPath(folderPath); // Set the full folder path
    }
  };

  // Handle submission of the folder path
  const handleSubmit = () => {
    if (!folderPath) {
      setMessage("Please enter or select a folder path."); // Display error if folder path is empty
      return;
    }

    setMessage(`Folder path submitted: ${folderPath}`); // Display the folder path
    demo(folderPath); // Pass the folder path to the demo function
  };

  // Demo function to print the folder path
  const demo = (path) => {
    console.log("Folder path passed to demo function:", path); // Print the folder path
    alert(`Folder path: ${path}`); // Show an alert with the folder path (optional)
  };

  return (
    <div className="App">
      <h1>Folder Path Submission</h1>

      <div className="folder-input">
        <label htmlFor="folder-path">Enter Folder Path:</label>
        <input
          type="text"
          id="folder-path"
          value={folderPath}
          onChange={handleFolderChange}
          placeholder="Enter the folder path here"
        />
      </div>

      <div className="folder-input">
        <label htmlFor="folder-select">Or Select Folder:</label>
        <input
          type="file"
          id="folder-select"
          webkitdirectory="true"
          onChange={handleFolderSelect}
        />
      </div>

      <button className="submit-button" onClick={handleSubmit}>
        Submit 
      </button>

      {message && <p className="message">{message}</p>}
    </div>
  );
}

export default App;














